import {
    CREATE_PROFILE,

} from '../actions/types'


const initialState = {
    profile: []

}
export default function (state = initialState, action) {
    switch (action.type) {
        case CREATE_PROFILE:
            return {
                ...state,
                items: action.payload
            };
        default:
            return state;
    }
}
